document.addEventListener("DOMContentLoaded", function () {
    var registerForm = document.getElementById("registerForm");

    if (registerForm) {
        document.getElementById("registerButton").addEventListener("click", register);
    } else {
        var errorMessageElement = document.getElementById("error");
        if (errorMessageElement) {
            errorMessageElement.innerHTML = 'Form not available. Please try again later.';
        }
    }
});

function register(event) {
    event.preventDefault();

    var emailRegex = /^[\w-]+(\.[\w-]+)*@[a-zA-Z0-9-]+(\.[a-zA-Z0-9-]+)*(\.[a-zA-Z]{2,})$/;
    var passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/;

    var jsonData = {
        name: document.getElementById("name").value,
        email: document.getElementById("email").value,
        password: document.getElementById("password").value,
        mobile: document.getElementById("mobile").value,
    };

    var confirmPassword = document.getElementById("confirmPassword").value;

    var errorElement = document.getElementById("error");

    // Clear previous errors
    errorElement.innerHTML = '';

    // Name validation
    if (!jsonData.name.trim() || !/^[a-zA-Z]+$/.test(jsonData.name)) {
        errorElement.innerHTML = 'Invalid name format!';
        return;
    }

    // Email validation
    if (!emailRegex.test(jsonData.email)) {
        errorElement.innerHTML = 'Invalid email format!';
        return;
    }

    // Password validation
    if (!passwordRegex.test(jsonData.password)) {
        errorElement.innerHTML = 'Password must include at least one uppercase letter, one lowercase letter, one numeral, one special character, and be at least 8 characters long!';
        return;
    }

    // Confirm password validation
    if (!confirmPassword.trim() || jsonData.password !== confirmPassword) {
        errorElement.innerHTML = 'Password and Confirm Password do not match!';
        return;
    }

    // Mobile validation
    if (!jsonData.mobile.trim() || !/^\d{8,}$/.test(jsonData.mobile)) {
        errorElement.innerHTML = 'Invalid Mobile Number!';
        return;
    }

    fetch('http://localhost:5055/register', {
        method: "POST",
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify(jsonData),
    })
        .then(response => {
            if (!response.ok) {
                throw new Error(`Server error: ${response.status} ${response.statusText}`);
            }
            return response.json();
        })
        .then(data => {
            console.log(data);
            if (data.message === undefined) {
                window.location.href = 'index.html';
            } else {
                errorElement.innerHTML = `Authentication failed: ${data.message}`;
            }
        })
        .catch(error => {
            console.error('Network error occurred', error);
            errorElement.innerHTML = 'Network error. Please check your connection.';
        });
}

document.addEventListener("DOMContentLoaded", function () {
    var searchForm = document.getElementById("searchForm");

    if (searchForm) {
        searchForm.addEventListener("submit", performSearch);
    } else {
        console.error("Search form element not found.");
    }

});

function performSearch(event) {
    event.preventDefault();

    var query = document.getElementById("query").value;

    // Make a GET request to the server with the query as a parameter
    fetch('http://localhost:5055/search-jobs', {
        method: "POST",
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({ q: query }),
    })
        .then(response => {
            if (!response.ok) {
                throw new Error(`Server error: ${response.status} ${response.statusText}`);
            }
            const contentType = response.headers.get('content-type');
            if (contentType && contentType.includes('application/json')) {
                return response.json(); // Parse JSON directly
            } else {
                throw new Error('Invalid content type in response');
            }
        })
        .then(data => {
            // Check if the job was found or not
            if (data.length > 0) {
                // Display the job details
                displaySearchResults(data);
            } else {
                // Display a message indicating that no jobs were found
                displayNoResults();
            }
        })
        .catch(error => {
            console.error('Network error occurred', error);
            // Handle the error, e.g., display an error message
        });
}


function displayNoResults() {
    var searchResultsContainer = document.getElementById("searchResults");

    // Clear previous search results
    searchResultsContainer.innerHTML = "";

    // Display a message indicating that no jobs were found
    var noResultsParagraph = document.createElement("p");
    noResultsParagraph.textContent = "Sorry, no jobs found.";
    searchResultsContainer.appendChild(noResultsParagraph);
}

// Update your displaySearchResults function
function displaySearchResults(searchResults) {
    // Check if searchResults is defined and has a length property
    if (searchResults && searchResults.length) {
        // If there are results, build the HTML content and display it
        let htmlContent = "";
        for (let i = 0; i < searchResults.length; i++) {
            // Modify this part based on your actual data structure
            htmlContent += `<p><strong>Job Name</strong>: ${searchResults[i].jobName}</p>`;
            htmlContent += `<p><strong>Company</strong>: ${searchResults[i].company}</p>`;
            htmlContent += `<p><strong>Location</strong>: ${searchResults[i].location}</p>`;
            htmlContent += `<p><strong>Description</strong>: ${searchResults[i].description}</p>`;
            htmlContent += `<p><strong>Contact</strong>: ${searchResults[i].contact}</p>`;
            // Add a horizontal line between job entries
            htmlContent += `<hr>`;
        }

        // Set the HTML content inside the modal
        $("#displaySearchResults").html(htmlContent);

        $("#searchResultsModal .modal-header").addClass("bg-primary text-white")

    } else {
        // If there are no results, display a message or handle it as needed
        $("#displaySearchResults").html("<p>No results found</p>");
    }
}

function viewUsers() {
    var request = new XMLHttpRequest();
    request.open('GET', '/view-user', true);
    request.setRequestHeader('Content-Type', 'application/json');

    request.onload = function () {
      if (request.status === 200) {
        var response = JSON.parse(request.responseText);
        var tableContent = document.getElementById('tableContent');
        var html = '';

        for (var i = 0; i < response.users.length; i++) {
          html += '<tr>' +
            '<td>' + response.users[i].id + '</td>' +
            '<td>' + response.users[i].name + '</td>' +
            '<td>' + response.users[i].email + '</td>' +
            '<td>' + response.users[i].password + '</td>' +
            '<td>' + response.users[i].mobile + '</td>' +
            '<td>' +
            '<button type="button" class="btn btn-warning" onclick="updateUser(\'' +
            JSON.stringify(response.users[i]).replaceAll('\"', '&quot;') + '\')">Update </button> ' +
            '<button type="button" class="btn btn-danger" onclick="deleteUser(\'' +
            response.users[i].name +'\')"> Delete</button>' +
            '</td>' +
            '</tr>';
        }

        tableContent.innerHTML = html;
      } else {
        console.error('Error fetching user data:', request.statusText);
      }
    };

    request.send();
  }

  // Call the function when the page is loaded
  window.onload = function () {
    viewUsers();
  };

function updateUser(data) {    
    var selectedUser = JSON.parse(data);        
    document.getElementById("updatePassword").value = selectedUser.password;     
    document.getElementById("updateMobile").value = selectedUser.mobile;     
    document.getElementById("updateButton").setAttribute("onclick", 'editUser("' + selectedUser.id + '")'); // changed from updateUser to editUser    
    $('#updateUserModal').modal('show'); 
}

function editUser(id) {
    console.log(id);
    var response = "";
    var jsonData = new Object();
    jsonData.password = document.getElementById("updatePassword").value; // corrected property name from name to password
    jsonData.mobile = document.getElementById("updateMobile").value; // corrected property name from location to mobile
    if (jsonData.password == "" || jsonData.mobile == "") {
        document.getElementById("editMessage").innerHTML = 'All fields are required!';
        document.getElementById("editMessage").setAttribute("class", "text-danger");
        return;
    }

    var request = new XMLHttpRequest();
    request.open("PUT", "/updateuser/" + id, true);
    request.setRequestHeader('Content-Type', 'application/json');
    request.onload = function () {
        response = JSON.parse(request.responseText);
        if (response.message == "User details has been successfully updated!") {
            document.getElementById("editMessage").innerHTML = 'Update User Details: ' + jsonData.name + '!';
            document.getElementById("editMessage").setAttribute("class", "text-success");
            window.location.href = 'user.html';
        } else {
            document.getElementById("editMessage").innerHTML = 'User details has not been updated successfully!';
            document.getElementById("editMessage").setAttribute("class", "text-danger");
        }
    };
    request.send(JSON.stringify(jsonData));
}

function deleteUser(name){

    var password = prompt("To delete the user, please enter your password: ");

    if(password === null){
        return;
    }

    var request = new XMLHttpRequest();

    request.open("DELETE", "/delete-user/" + name, true);
    request.setRequestHeader('Content-Type','application/json');

    request.onreadystatechange = function () {
        if (request.readyState === 4) {
            var response = JSON.parse(request.responseText);
            if (response.message === `User '${name}' deleted successfully.`) {
                alert("User deleted successfully");
                window.location.reload();
            } else {
                alert("Unable to delete user. Please check password and try again.")
            }
        }
    };
    
    request.send(JSON.stringify({password: password}));

}
